import styled from 'styled-components';

export const CheckoutItemConatainer = styled.div`
	width: 100%;
	display: flex;
	min-height: 100px;
	border-bottom: 1px solid darkgrey;
	padding: 15px 0;
	font-size: 20px;
	align-items: center;
`;

export const ImageContainerContainer = styled.div`
	width: 23%;
    padding-right: 15px;
`;

export const ImageContainer = styled.img`
    width: 100%;
    height: 100%;
`;

export const { NameContainer, PriceCaontainer } = styled.span`
	width: 23%;
`;

export const QuantityCaontainer = styled.span`
	width: 23%;
`;

export const ArrowContainer = styled.div`
    cursor: pointer;
`;

export const ValueContiner = styled.span`
    margin: 0 10px;
`;

export const RemoveButtonContainer = styled.div`
    padding-left: 12px;
    cursor: pointer;
`;
